import React, { Component } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getDocuments } from "../actions/DocumentActions";

class Dashboard extends Component {

  componentDidMount() {
    this.props.getDocuments();
  }

  render() {
    return (
      <div className="container " id="contentboard">
        <div className="col-md-10 card card-body bg-light mb-2">
        <h1 className="display-4 text-center">Documents</h1>
        {documents.map(document => (
                   <Content key={document.documentId} document={document} />
                  ))}
        </div>
      </div>


    );
  }
}
Dashboard.propTypes = {
  getDocument: PropTypes.func.isRequired,
  document: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  document: state.documents.document
});
export default connect(
  mapStateToProps,
  { getDocument}
)(Dashboard);
